import React from "react";
import ReactDOM from "react-dom";
import Card  from "./Cards";
import Sdata from "./Seriesdata";
import "./index.css"


// console.log(Sdata[0].sname);

function netflixcard(val){
  console.log(val);
  return(
    <Card
    key = {val.id} 
    imgsrc={val.imgsrc} 
   title={val.title} sname={val.sname} 
   links={val.links} />
  );

}



ReactDOM.render(
  <>

  <h1 className="heading_style">List of Top 5 Netflix Series 2021</h1>



  {Sdata.map(netflixcard)}

